  def user_has_drop_off_time?
    if franchise_profile_for_user.nil?
      return false
    else
      return !SaleConsignorSignUp.non_internal_consignor_sign_up_for_sale(sale_number, franchise_profile_for_user.id).nil?
    end
  end
  
  def drop_off_time_for_user
    if franchise_profile_for_user.nil?
      return ""
    else
      consignor_time = SaleConsignorSignUp.non_internal_consignor_sign_up_for_sale(sale_number, franchise_profile_for_user.id)
      if consignor_time.nil?
        return "No Time"
      else
        return "Your Drop-Off Time:<br><b>#{consignor_time.sale_consignor_time.date.strftime("%b %d, %Y")}, #{consignor_time.sale_consignor_time.start_time.strftime("%I:%M %p")}</b>"
      end
    end
  end

  def drop_off_time_for_user_2017
    if franchise_profile_for_user.nil?
      return ""
    else
      consignor_time = SaleConsignorSignUp.non_internal_consignor_sign_up_for_sale(sale_number, franchise_profile_for_user.id)
      if consignor_time.nil?
        return "No Time"
      else
        return "#{consignor_time.sale_consignor_time.date.strftime("%b %d, %Y")}, #{consignor_time.sale_consignor_time.start_time.strftime("%I:%M %p")}"
      end
    end
  end

  def user_has_volunteer_time?
    if franchise_profile_for_user.nil?
      return false
    else
      return !SaleVolunteerSignUp.volunteer_sign_ups_for_sale(sale_number, franchise_profile_for_user.id).empty?
    end
  end
  
  def volunteer_jobs_for_user
    if franchise_profile_for_user.nil?
      return ""
    else
      volunteer_jobs = SaleVolunteerSignUp.volunteer_sign_ups_for_sale(sale_number, franchise_profile_for_user.id)
      if volunteer_jobs.empty?
        return "No Job"
      else
        rvalue = []
        volunteer_jobs.each do |job|
          rvalue << VolunteerJobDrop.new(job.sale_volunteer_time)
        end      
        rvalue        
      end
    end
  end

