  def process_shopping_cart_url
    "/customer/process_shopping_cart?franchise_id=#{franchise_number}"
  end

  def shopping_cart
    return [] if @user.nil?
    rvalue = []
    for order in @user.profile.pending_orders_for_sale(sale_number)
      rvalue << OrderDrop.new(order)
    end
    rvalue
  end

  def shopping_cart_sub_total
    return 0 if @user.nil?
    return @user.profile.shopping_cart_sub_total(sale_number)
  end

  def shopping_cart_sales_tax
    return 0 if @user.nil?
    return @user.profile.shopping_cart_sales_tax(sale_number)
  end

  def shopping_cart_total
    return 0 if @user.nil?
    return @user.profile.shopping_cart_total(sale_number)
  end

private

  def page_of_featured_items
    if @search_term.empty_or_nil?
      @sale.featured_items(@category, @sub_category, @size).paginate(
        :per_page => 45,
        :page => @context.registers[:controller].send(:params)[:page]
      )
    else
      @sale.featured_item_search(@search_term, @category, @sub_category, @size).paginate(
        :per_page => 45,
        :page => @context.registers[:controller].send(:params)[:page]
      )
    end
  end

end